mlMobileText_ChainTalkBodyText.326:
I don't think it's good
for Kaho to earn this kind of trust,
though.

mlMobileText_ChainTalkBodyText.342:
And if you could convey our gratitude
for the journalist sincerely listening to our story,
that would be wonderful!

mlMobileText_ChainTalkBodyText.526:
You're picking me up
for tomorrow's shoot,
right?

mlMobileText_ChainTalkBodyText.764:
But they'll
return the favor,
right?!

mlMobileText_ChainTalkBodyText.965:
Right now,
if I let my guard down,
I start humming my solo song.

mlMobileText_ChainTalkBodyText.992:
I'm still in a good mood
from the earlier livestream,
it's lingering~

mlMobileText_ChainTalkBodyText.1006:
It's quite different
from the previous SHHis songs,
so I hope you look forward to it.
